import React from "react";

export const Dashboard = () => {
  return (
    <div className="dashboard-container">
      {/* Side Panel */}
      <div className="side-panel">
        <h3>Options</h3>
        <ul>
          <li>Option 1</li>
          <li>Option 2</li>
          <li>Option 3</li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="main-content">
        <div className="button-container">
          <button className="btn btn-custom">Download</button>
          <button className="btn btn-custom">Save</button>
        </div>

        {/* Images displayed side by side */}
        <div className="images-container">
          <img src="public\img\about.jpg" alt="img 1" className="dashboard-image" />
          <img src="image2.jpg" alt="Image 2" className="dashboard-image" />
        </div>
      </div>
    </div>
  );
};
